import React from 'react';
import classes from './SecondPost.module.css'

const SecondPost = (props) => {
    return (
        <div className='dialogs'>
            <div className='dialogs-item'>
                <div className='item'>
                    Dima
                </div>
                <div className='item'>
                    Andre
                </div>
                <div className='item'>
                    Sasha
                </div>
            </div>
        </div>
    );
};

export default SecondPost;
